import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./SellCarPage.css";

function SellCarPage() {
  const [step, setStep] = useState(1);
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    carMake: "",
    carModel: "",
    year: "",
    mileage: "",
    vehicleType: "",
    condition: "",
    fuelType: "",
    transmission: "",
    country: "",
    city: "",
    price: "",
    negotiable: false,
    description: "",
    // Assume photo handling will be done later, for now we'll ignore it.
  });

  const handleChange = (field, value) => {
    setFormData((prev) => ({ ...prev, [field]: value }));
  };

  const nextStep = () => setStep((prev) => prev + 1);
  const prevStep = () => setStep((prev) => prev - 1);

  const handleSell = async () => {
    // POST the formData to the car endpoint
    try {
      const response = await fetch("http://127.0.0.1:8000/api/cars/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          // You can add authentication headers here if needed.
        },
        body: JSON.stringify(formData),
      });
      if (!response.ok) {
        const errorData = await response.json();
        alert("Error selling car: " + JSON.stringify(errorData));
        return;
      }
      // On successful creation, redirect to the car list page (e.g., /buy)
      navigate("/buy");
    } catch (error) {
      console.error("Error selling car:", error);
      alert("An error occurred. Please try again.");
    }
  };

  return (
    <div className="sell-container">
      <div className="sell-form">
        {step === 1 && (
          <StepOne
            formData={formData}
            onChange={handleChange}
            onNext={nextStep}
          />
        )}
        {step === 2 && (
          <StepTwo
            formData={formData}
            onChange={handleChange}
            onNext={nextStep}
            onPrev={prevStep}
          />
        )}
        {step === 3 && (
          <StepThree formData={formData} onPrev={prevStep} onSell={handleSell} />
        )}
      </div>
    </div>
  );
}

